import React from "react";
import logo from "../../public/content/SVG/Asset 2.svg";
import { motion } from "framer-motion";
import "./Nav.css";

function Nav() {
  return (
    <div className="nav">
      <div className="logo">
        <img src={logo} alt="ABURA-logo" className="logoImg"></img>
        <motion.svg>
          <path
            class="cls-1"
            d="m17.6,39.5c10.5,0,17.6-7,17.6-17.6V0h-6.4v22c0,7.2-4.5,11.9-11.2,11.9s-11.2-4.8-11.2-11.9V0H0v21.9c0,10.6,7.1,17.6,17.6,17.6Z"
          />
        </motion.svg>
      </div>
    </div>
  );
}

export default Nav;
